#include "OverdoseEditor.h"

//==============================================================================
OverdoseEditor::OverdoseEditor (OverdosePlugin* const ownerFilter)
    : PluginEditorComponent (ownerFilter)
{
    
	addAndMakeVisible (meter = new MeterComponent(0, 0, 2));
	meter->setBounds (242, 16, 10, 74);
	meter->setDecay(10, 4, 0.707f);

	startTimer(1);

	background = ImageCache::getFromMemory (skin_jpg, skin_jpgSize);
	Theknob = ImageCache::getFromMemory (knob_png, knob_pngSize);
	Theknob2 = ImageCache::getFromMemory (knob_png, knob_pngSize);
	Theknob3 = ImageCache::getFromMemory (knob_png, knob_pngSize);


	 addChildComponent (Sliders[drive] = new ImageKnob (String::empty));
	 Sliders[drive]->setVisible(false);
	 Sliders[drive]->setStitchedImage(Theknob, ImageKnob::Vertical, 39);
	 Sliders[drive]->setVisible(true);
	 Sliders[drive]->setSliderStyle (Slider::RotaryVerticalDrag);
	 Sliders[drive]->setTextBoxStyle (Slider::NoTextBox, true, 30, 10);
	 Sliders[drive]->setRange (0.0, 1.0, 0.01);
	 Sliders[drive]->setBounds (20, 14, 64, 64);
	 Sliders[drive]->setPopupDisplayEnabled(true, this);
	 Sliders[drive]->addListener (this);

	 addChildComponent (Sliders[muffle] = new ImageKnob (String::empty));
	 Sliders[muffle]->setVisible(false);
	 Sliders[muffle]->setStitchedImage(Theknob2, ImageKnob::Vertical, 39);
	 Sliders[muffle]->setVisible(true);
	 Sliders[muffle]->setSliderStyle (Slider::RotaryVerticalDrag);
	 Sliders[muffle]->setTextBoxStyle (Slider::NoTextBox, true, 30, 10);
	 Sliders[muffle]->setRange (0.0, 1.0, 0.01);
	 Sliders[muffle]->setBounds (94, 14, 64, 64);
	 Sliders[muffle]->setPopupDisplayEnabled(true, this);
	 Sliders[muffle]->addListener (this);

	 addChildComponent (Sliders[output] = new ImageKnob (String::empty));
	 Sliders[output]->setVisible(false);
	 Sliders[output]->setStitchedImage(Theknob3, ImageKnob::Vertical, 39);
	 Sliders[output]->setVisible(true);
	 Sliders[output]->setSliderStyle (Slider::RotaryVerticalDrag);
	 Sliders[output]->setTextBoxStyle (Slider::NoTextBox, true, 30, 10);
	 Sliders[output]->setRange (0.0, 1.0, 0.01);
	 Sliders[output]->setBounds (168, 14, 64, 64);
	 Sliders[output]->setPopupDisplayEnabled(true, this);
	 Sliders[output]->addListener (this);
	 


    // create and add the midi keyboard component..
    addAndMakeVisible (midiKeyboard
        = new MidiKeyboardComponent (ownerFilter->keyboardState,
                                     MidiKeyboardComponent::horizontalKeyboard));


    // register ourselves with the filter - it will use its ChangeBroadcaster base
    // class to tell us when something has changed, and this will call our changeListenerCallback()
    // method.
    getFilter()->addChangeListener (this);
}

OverdoseEditor::~OverdoseEditor()
{
    getFilter()->removeChangeListener (this);

    deleteAllChildren();
}


//==============================================================================
void OverdoseEditor::paint (Graphics& g)
{
    g.drawImageWithin (background,
                       0, 0, 272, 104,
                       RectanglePlacement::centred,
                       false);

	g.drawRoundedRectangle(10, 10, 252, 84, 10, 1);
	g.setColour(Colours::white);
	g.drawRect(241, 15, 12, 76, 1);
                  
}

void OverdoseEditor::resized()
{
	Sliders[drive]->setBounds (20, 14, 64, 64);
	Sliders[muffle]->setBounds (94, 14, 64, 64);
	Sliders[output]->setBounds (168, 14, 64, 64);
	meter->setBounds (242, 16, 10, 74);
}

//==============================================================================
void OverdoseEditor::changeListenerCallback (void* source)
{
    // this is the filter telling us that it's changed, so we'll update our
    // display of the time, midi message, etc.
    updateParametersFromFilter();
}

void OverdoseEditor::sliderValueChanged (Slider* caller)
{

	 for(int i = 0 ; i < numSliders ; i++){
          if(Sliders[i] == caller){
               getFilter()->setParameterNotifyingHost (i, (float) caller->getValue());
               return;
          }
     }
}

